const Hello = (props) => {
  return (
    <div>
      <p>Hello world { props.name }, you are {props.age} years old</p>
    </div>
  )
}

const App = () => {
  const age = 31
  const name = 'Peter'
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="Mark" age="28"/>
      <Hello name={name} age = {age} />
    </div>
  )
}

export default App
